resources.description:
Rota tipo 'GET' para acessar informações de CEP
Obrigatório informar cep de 8 dígitos na url de requisição:

- https://brasilapi.com.br/api/cep/v1/{cep};

Requisição não precisa de corpo.

```response

{
  "cep": "89010025",
  "state": "SC",
  "city": "Blumenau",
  "neighborhood": "Centro",
  "street": "Rua Doutor Luiz de Freitas Melro",
  "service": "viacep"
}
```
Erro ocorre caso tente pesquisar um cep e informa a quantidade errada de dígitos:
```response
{
	"message": "Todos os serviços de CEP retornaram erro.",
	"type": "service_error",
	"name": "CepPromiseError",
	"errors": [
		{
			"name": "ServiceError",
			"message": "CEP NAO ENCONTRADO",
			"service": "correios"
		},
		{
			"name": "ServiceError",
			"message": "Erro ao se conectar com o serviço ViaCEP.",
			"service": "viacep"
		},
		{
			"name": "ServiceError",
			"message": "CEP não encontrado na base do WideNet.",
			"service": "widenet"
		},
		{
			"name": "ServiceError",
			"message": "CEP não encontrado na base dos Correios.",
			"service": "correios-alt"
		}
	]
}
```

Rota tipo 'POST' para fazer o login na aplicação e obter o token de acesso para as rotas protegidas.

- {{ _.BASE_URL }}/login/

Obrigatório informar:

- email: tipo 'string';
- password: tipo 'string';

```response

{
	"accessToken": "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1dWlkIjoiMDIxMmZmNGEtOTRkZS00Yzk3LThmYmYtZTdlNGJiMDZlMjU4IiwiaXNfYWRtaW4iOmZhbHNlLCJpYXQiOjE2NjIxNTM2OTksImV4cCI6MTY2MzAxNzY5OSwic3ViIjoiW29iamVjdCBVbmRlZmluZWRdIn0.S9DZaBveaNbQBmQklwgzpEI_FI8VTUW0W4Ankv1qS9E"
	"user": {
		"email": "golimar4@mail.com",
		"volunteer": "true",
		"id": 4,
		...
	}
}
```
Erros que podem ocorrer caso algum dado dos dados abaixo sejam mandados incorretamente:
-	email: "Cannot find user";
-	password: "Incorrect password"

Rota do tipo 'GET' para listar os dados de um único usuário cadastrado, pode visualizar todos os usuários;

- {{ _.BASE_URL }}/users/{userID}

É necessário envio de token de autenticação "Bearer Token";

Não existe corpo na requisição.

```response
{
	"email": "golimar3@mail.com",
	"password": "$2a$10$6yoUMAfOO2bZyXh0B8gMFeIYMFOBpvL2pK1kY6NnCSMfnzeg1JIDy",
	"id": 3
}
```
Em caso de não passar o token, a resposta será
```response
"Missing token"
```

Rota do tipo 'PATCH' para alterar/adicionar os dados de um único usuário cadastrado, pode alterar apenas os próprios dados;

- {{ _.BASE_URL }}/users/{userID}

É necessário envio de token de autenticação "Bearer Token";

Se não for passado corpo na requisição, nenhum dado será alterado.

```response
{
	"email": "golimar3@mail.com",
	"password": "$2a$10$6yoUMAfOO2bZyXh0B8gMFeIYMFOBpvL2pK1kY6NnCSMfnzeg1JIDy",
	"id": 3
}
```
Em caso de não passar o token, a resposta será
```response
"Missing token"
```

Rota tipo 'POST' para fazer o registro na aplicação. O endpoint irá cadastrar o usuário na lista de "Users", sendo que os campos obrigatórios são os de email e password.
Você pode ficar a vontade para adicionar qualquer outra propriedade no corpo do cadastro dos usuários.

- {{ _.BASE_URL }}/register/

Obrigatório informar:

- email: tipo 'string';
- password: tipo 'string';

```response

{
	"accessToken": "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJlbWFpbCI6ImdvbGltYXI2QG1haWwuY29tIiwiaWF0IjoxNjcyODk4NzY3LCJleHAiOjE2NzI5MDIzNjcsInN1YiI6IjUifQ.OMwz9BDEyZJfEiX4ys1u3lUc_ignBmrv23GXdkCEbus",
	"user": {
		"email": "golimar6@mail.com",
		"id": 5,
		...
	}
}
```
Erro ocorre caso tente cadastrar um e-mail já cadastrado:
-	"Email already exists"
